class UiHelpers{static formatDateTime(n){return moment(n).format("YYYY-MM-DD HH:mm:SS")}static showErrorToast(n,t,i){$(document).Toasts("create",{"class":"bg-danger",title:n,subtitle:t,body:i})}static debounce(n,t){var i=null;return function(){clearTimeout(i);var r=arguments,u=this;i=setTimeout(function(){n.apply(u,r)},t)}}}